        "**What key things have you worked on over the past six months have brought you fulfilment? Describe the impact on the success of your team, department and organization.**": "Working on the mobile app was really fulfilling and a highlight of my career. I think being able to build a brand new app from scratch (with great functionality) in under 3 months is a great success! The team I worked with were incredible, and we all pulled on each-others strengths to make sure we stuck together and got the job done. Working in an extremely agile and fast paced method meant that things weren't perfect, and some things might have been missed or needed extra detail - but I like to think we built really strong communication paths between us, so that we could ask and be answered pretty swiftly. \n\nThe impact past the small team, I feel has been pretty immense. I think the wider Contact team were happy to:\na) see the previous mobile app be replaced \nb) see the tech team deliver something so quickly and of high quality\nand we constantly received positive feedback throughout the quarter on how nice the app was coming along. This also meant that I had to deal with many stakeholders (Talent Team in ops), and had to build strong relationships with those team members so that they would trust I was building the right solution for them and our creatives. I started this by hosting a workshop with that team, and consistently kept in touch with them throughout the quarter so that were kept in the loop.\n\nOther things I've worked on that have brought impact:\nContact Open\nQ3 Planning\nAutomated NPS Surveys for Creatives\nIntroduction (and closure) of Productboard in attempt to centralise user feedback and prioritise backlogs\nSplitting out the Name field into First Name and Last Name\nIntroduction to Mixpanel\n\nI feel like k have con\n\nIâ€™ve also worked on my presentation skills and ability to talk in larger groups - which is something I wanted to tackle over the last few months.",
        "What blockers or challenges did you experience in this review period that made it harder to achieve your goals?": "I donâ€™t think there were many challenges localised to me, rather typical challenges we might face as a small team in a startup. Few challenges I can think of would be surrounding the limitations of being able to prioritise and priorities changing, but, itâ€™s what Iâ€™m used to given my background in startups so Iâ€™m happy to continue forward and adapt.\n\nOne challenge around Contact Open was around misconceptions of what the product would actually be. I think in the research stages before I joined, it was made out to be a extremely big product that was complex, and then having to prioritise features from this led so some confusion from the Contact team where they thought something would be in the app at launch when it wasnâ€™t planned to be. One thing I took from this was to ensure changes and progressions are posted in a public channel so that the wider team can absorb these changes, rather than take a one-to-one approach which",
        "In what ways have you developed during this review period?": "Iâ€™ve become more confident in my position at Contact, and believe that the team trust me to deliver what I say Iâ€™ll deliver. Iâ€™ve built really strong work relationships across the board and this has led me to be able to push and pull in scenarios to make sure we can deliver new features, improvements, and bug fixes on time.\n\nIâ€™ve learned to adapt my way of working to different people, and adapt my style of communication - without losing my essence or personality.\n\nAs a PM, Iâ€™ve continued to adapt to an ever changing landscape and still deliver great work when leading a cross functional team. Being able to identify potential issues that may crop up in the short term and long term, and relay them or put the work in to try and reduce any risks.",
        "What are 2-3 skills youâ€™d like to acquire, develop or refine over the next review period? Do you feel there is an area of potential that you haven't explored yet?": "Iâ€™d like to work on the following:\n\n- User Feedback\nThis is something Iâ€™m used to and have done many times before, I would like to introduce this into my daily work over the next few weeks/months so I can ensure weâ€™re building the right things\n\n- Product Strategy\nI got to work on this a fair amount in the lead up to Q3, and setting out metrics, goals, and targets was really good. Iâ€™d love to be able to do this again in the lead up to next quarter",
