        "**What key things have you worked on over the past six months have brought you fulfilment? Describe the impact on the success of your team, department and organization.**": "**Ownership and independence within design team**\nA goal that came mostly from peer feedback last review cycle, was equipping Mikey and Rashmi to work closely and confidently with their respective product manager, with limited hand holding from myself. While of course I've look to provide regular catch ups and crit sessions with my team, it has been brilliant to see Rashmi work so well with Simon, and Mikey with Arun, during periods where I've been slightly immersed elsewhere, or simply away on holiday. The team feels stronger and more confident, which ultimately is my main goal as a manager. \n\n**Overseeing continuous improvements to the booker experience**\nI greatly enjoyed being involved in the research and concept ideation for new booker features earlier in the year. Coupled with the new CAJ header shipping â€” multi vertical bookings, the new booker dashboard, and the bookmarking feature (shipping next week), have all been a big step forward for bookers on Contact. \n\n**Embracing leadership initiatives**\n\n- 5 step plan\n- No Meeting Weds\n- New office\n- Cost of living pay / Pay backdating\n\nI think I've become more confident sharing my thoughts and being decisive around leadership decisions, in particular within the last 3 months. I've enjoyed leading on, or being involved in various initiatives, such as the ones mentioned above. I'm always eager to go the extra mile to make day-to-day work and life easier and more enjoyable for the company â€” and I'm proud I've been proactive in doing so since new year.",
        "What blockers or challenges did you experience in this review period that made it harder to achieve your goals?": "One goal was to really progress with the standard of what we ship. While I do think I've contributed to improving this standard, if realistic, a switch of focus occurred in the spring to **truly prioritise shipping quickly and often â€” which has at times proved a challenge against the original goal**. Related, we've also often opted for \"tacking on\" additional features instead of really rethinking aspects of our design, again to prioritise speed. However, I'm confident with really nailing a balance before we hit 2023.\n\n**At points it's felt challenging to truly be present for team members**, but specifically around the various design projects they have worked on. If honest, I do think I fell short frequently earlier in the year, especially with Mikey (him working on a separate product was an easy excuse to be slightly detached). However we've established a really solid flow in the last few weeks, after some useful tips from my coach. I think the key change will be designated days for me to dedicate to each team/person.\n\nI had a goal to work on a branding project, and obviously **the blocker here was that it was delayed!** I'll likely be less involved when we pick this up eventually, but it's still a goal to oversee its implementation.\n\nFinally, it's **sometimes felt hard to really be motivated with nailing down and improving our internal design team process**, when so much wider process and structure has constantly changed (2 different squad structures, 3 different OKR planning strategies, etc). However, I'm really happy with the latest squad revamp and feel empowered with how design can contribute (especially through the R&D squads).",
        "In what ways have you developed during this review period?": "**Stronger decision maker within leadership decisions**\nAs hinted above, I do think I've progressed with being more proactive within various leadership discussions and ideas. In the past I've possibly been content with mostly listening and minimal participation, but I've actively tried to be more a louder voice and also a decisive voice. I think this has helped get various initiatives over the line, and ultimately help the company. \n\n**Built awareness and learnt more about how my team like to work and grow**\nMy critical review of the 6 months is that I've not always supported Mikey and Rashmi closely enough. But to look toward the positive, I've definitely learnt a lot about how they like to work, what motivates them, and what support they're after. I'm really eager to utilise this moving into the future.\n\n**I've learnt a LOT about how to work with metrics**\nI'm confident I've up-skilled in how to build OKRs around a lean and mean collection of metrics, and how that feeds through to day-to-day work and sprint planning. I've learnt more about the pros and cons of metrics driven culture, and look forward to continue this learning moving forward.",
        "What are 2-3 skills youâ€™d like to acquire, develop or refine over the next review period? Do you feel there is an area of potential that you haven't explored yet?": "**Lead on a new biz and product strategy from start to finish**\nI'm excited to lean into the potential of the R&D team, and embrace working fast to conceptualise, design, and ship something fresh and exciting for Contact. I want to lean towards quick-fire research and hypothesis testing, which is sometimes where we've struggled in the past (so a positive step forward for Contact) \n\n**Clearly demonstrate how design can improve our key metrics**\nEither first hand through my design work in Engagement team, or through the design work elsewhere in my team, I'm excited and motivated to utilise design to get our key metrics move upward. \n\n**Build our wider design system for product, brand, and marketing**\nEveryone's likely bored of me chatting about design system goals now, but for the first time in a year, Suhael has unblocked my vision for a fully in-sync design system between both design and engineering. We've already started with baby steps on this new design system, and I'm hyped to get this fully launched later in the year. I'm eager to simply learn by doing in this area. This will be a huge step forward for Contact, improving the our speed of shipping even further, but also the quality of what we're building.",
