        "**What key things have you worked on over the past six months have brought you fulfilment? Describe the impact on the success of your team, department and organization.**": "Creating the model guide deck for our creatives has been really rewarding. The positive responses from our creatives on how the deck has helped them with filming their self-tapes and understanding industry terminology highlighted the value in creating resources such as these for our creatives. By creating the deck, this increased the operational efficiency of the bookings team as this reduces the manual responses to models on frequent questions that crop up.\n\nLapsed Booker Meetings and Reach-outs: It's great to connect with bookers in person and continue building rapport with the bookers. Super friendly and a really nice switch up to the day-to-day of the working week. This has been really rewarding as I've always enjoyed a varied workload that involves being a part of different projects. I believe it's also had a positive impact amongst the team, in getting valuable feedback on our platform and where we can add to our platform. \n\nHandling LANE castings- the monetary value of these jobs is super rewarding, and seeing how it contributes towards our OKR revenue targets. The jobs I've managed totalling over Â£32,000 when we've factored in all the model fees, usage and recall fees from Lane casting briefs. I really enjoyed taking on the challenge of Lane briefs, the jobs tend to be more complex and I always learn something new. For example, where we can implement additional fees such as wardrobe, recall and travel day fees. This has positively impacted how I've been able to handle other jobs that require less manual steps. It has also helped inform how I get to certain fees on other jobs, using the briefs as a reference point for usage.",
        "What blockers or challenges did you experience in this review period that made it harder to achieve your goals?": "Transparency:\n\nOne of my goals last quarter was towards creating events for our bookers to increase revenue and gauge further feedback on the platform. A lot of planning went into the booker dinner event and there was a budget blocker with this.",
        "In what ways have you developed during this review period?": "Public Speaking- My confidence with public speaking has improved so much when it comes to speaking in the Operations Showcase and on All Hands. This has also helped with my confidence in speaking across team meetings and putting forward more of my ideas. One of my goals was to feel less anxious before having to present. Utilising meditation and the sanctus coaching sessions to work through this has really helped with my personal growth. \n\nIndependent problem solving- I've encountered difficult client situations that I've navigated more independently, this in turn has developed my problem solving skills and I find it easier to handle situations that crop up with other bookers. I feel more confident in handling and diffusing these situations, where we're able to come to a resolution for the booker and our creatives. \n\nMore nuanced in negotiating rates and increasing the fees for models, I believe my success rate has improved in getting the rates higher for our creatives, below examples of these instances:\n\nNyome SWIM: initial job was Â£500 for a day, pushed to Â£1.5k\nLime Scooters: initial job was Â£500, pushed to Â£2,5k per model\n\nThis has positively impacted my goal which is to always secure higher rates for creatives so they're paid fairly.",
        "What are 2-3 skills youâ€™d like to acquire, develop or refine over the next review period? Do you feel there is an area of potential that you haven't explored yet?": "Client Succession/Experience- To continue developing the skills that help towards improving our bookers' experience with Contact. I really enjoy meeting bookers in person, so I'm keen to utilise my learning and development days to see what other skills can be explored in this umbrella area. \n\nContinue up-skilling in influencer jobs, this is an area of jobs management that I'm starting out at but it's an avenue I'd love to carve out more time working on. Establishing an influencer division amongst our creatives has a lot of monetary value that could help towards reaching our revenue targets for the next quarter.",
