        "**What key things have you worked on over the past six months have brought you fulfilment? Describe the impact on the success of your team, department and organization.**": "One of the key things I have worked on in the last 6 months that have brought me the most fulfilment was setting up my â€˜Overdue Invoice Trackerâ€™. This helped me to organise, monitor and appropriately act on the status of every invoice. This helped to bring structure in my daily tasks, but also to visually see the impact of my efforts at the end of each month. I hope that in creating this tracker, and for taking on this role, the impact my team has felt is one of relief; this spreadsheet is available for an up to date status update and just to know that someone is acting on each invoice as necessary. The impact this has had on the company widely is also financial, with chasing invoices I estimated a retrieval of around Â£30k in overdue payments from when I joined Contact.\n\nWorking on the Quarterly TPA Payments has also brought me fulfilment. Again, setting up my own system that I know will work smoothly every quarter is very satisfying. This key task felt like a step above the â€˜Overdue Invoice Trackerâ€™, as the steps in this process needed to work in conjunction with other agencies, their schedules, and also with our own Community Team. In working alongside Julia, Alice, BB and Shannon to set up the TPA payment system Iâ€™ve had the chance to work collaboratively and hope my organisation skills are felt to be beneficial to others. As this work had an impact beyond the company, I was proud that with the Q2 payments (my second cycle of TPA payments) I could be of help for other TPAâ€™s, who thanked me for being helpful and I could handle the process independently. When demonstrating the TPA payments process in a group meeting, I felt that my planning, structure, and communication was appreciated. I was really pleased when I received the feedback that my spreadsheets easily communicated the task at hand; that anyone could look over them and clearly read the information, status or completion of a payment. I hope that this has had a positive impact on Contact, as working well with our TPAâ€™s is a big part of our community.",
        "What blockers or challenges did you experience in this review period that made it harder to achieve your goals?": "I found a lot of difficulty, and anxiety, in trying to manage both accounts and job bookings when starting at Contact. Challenges within this was how to manage my time, and some days one focus demanded more time than the other. I felt that in splitting my time, it was hard to complete jobs to the best of my ability. I struggled with confidence when picking up, and managing jobs, and ultimately this led to me feeling anxious in my day-to-day. It was therefore harder to achieve my account management responsibilities and goals too. I felt this was overcome with the help of Kirsty and Shannon, who helped to create a safe space to talk honestly, and my role and responsibilities were adapted moving forward. We worked through solutions and how to expand my role in accounts; picking up creativeâ€™s payments, research into booker payment habits and future projects (a biannual invoice report, TPA Commission History Report and â€˜Advanceâ€™ advance payment tracker). Iâ€™m now really excited to take on these projects and goals and create resources that I hope will be useful company wide.\n\nAnother** **challenge and blocker I had within this review period was having limited access to some areas of accounts. Without a login to the online banking, I felt bad checking in regarding specific payments with Kirsty and also relying on her availability to make manual and batch payments. I also found it tricky to have limited knowledge around payment statuses in Xero - I was unsure if the updates were being kept up to date or simply if there were none. As I only have partial visibility, this made it harder for me to achieve my goal of staying on top of payments and making creative payments, as there was sometimes a delay in the process. With banking being a sensitive area, I know that solutions arenâ€™t always easy and this may just take time to adapt to on my part.",
        "In what ways have you developed during this review period?": "The biggest way I feel I have developed during this review period is in my confidence: taking ownership of my role, acting independently, knowing when to lean on team members or when to pick up invoice and payment queries. I believe this has positively impacted my performance, as my self-belief in replying to queries or concerns no longer makes me feel anxious, and in turn I feel far more productive. I feel that I have set down a solid foundation in my first 6 months at Contact and hope to expand my role and knowledge moving forward.\n\nIn my past, I have been used to working very independently, and I feel I have developed in knowing when, and how, to work collaboratively. Having weekly accounts meetings with Kirsty means we have dedicated time to work through and complete more complex account issues together. Knowing when to help the bookings team with picking up vendor forms, or invoicing queries has also felt really satisfying and Iâ€™ve enjoyed building relationships where we can lean on each other for help. I feel that this will help the ops team in the future, knowing that they can rely on my assistance and also for my personal development in this area.",
