        "**What key things have you worked on over the past six months have brought you fulfilment? Describe the impact on the success of your team, department and organization.**": "Over the last 6 months, Iâ€™ve worked on tasks outside of my daily responsibilities which have helped me develop a wider set of professional and personal skills:\n\n\n1. Working with Kirsty in hosting my first Bookings Team workshop was a great opportunity to work on my leadership, time management and public speaking skills. I enjoyed creating a safe space for my peers and felt a strong sense of fulfilment hearing the positive feedback. I learned a deeper form of empathy and how important it is to take into account others in your team; how to ensure the workshopâ€™s fulfilling for them + received in the best way, how to keep them engaged and what the main important takeaways would be that would in-turn improve their working environment. It was a lovely experience facilitating a workshop that would bring my team closer together. I also saw this as an opportunity to practice my public speaking skills on a small scale, which would help me as I take on more responsibility in future. Iâ€™ve also learned how chatty we are as a team and time management would be something to keep an eye on in the next one!\n2. My recent shadowing call with the Commercial Team was also another stepping stone in my progression. I enjoyed taking the time to plan an itinerary and talk Beth and Koby through the daily responsibilities in the Bookings Team. I valued how encouraging and supportive Kirsty was during the process, and appreciate the confidence she had in me with speaking on behalf of my team. This experience taught me how to manage my next shadowing call better with the wider-team in the upcoming months.\n3. Assisting the Hiring Team with screenings earlier this year was one of the most important stages in my progression. I enjoyed contributing to the growth of the company by being the spokesperson for the team. From learning how to structure a screening to churning out quick yet informative notes; I enjoyed every second of this tedious yet exhilarating task and appreciate the interpersonal skills Iâ€™ve further developed which Iâ€™ve taken on-board with me both in and outside the workplace.\n4. Contributing to the Bookings Teamâ€™s goal alignment calls has also been something Iâ€™m proud to be writing about in this round of performance reviews. While this is a new responsibility, Iâ€™ve already enjoyed speaking with my peers on a deeper capacity and am especially looking forward to ways I can contribute to their progression towards their goals. I, by nature enjoy having more thoughtful conversations and will do all that I can to ensure my peers are supported in whatever way possible. Iâ€™ve seen from the start how each of my peers have joined the company and grown professionally, which Iâ€™m looking forward to celebrating with them in the months to come.\n5. The last few months has also allowed me to work with Peter on the lapsed booker outreach task and Maylis on the booker email campaigns for Retentionâ€™s OKRâ€™s. During Lucyâ€™s time here, I also enjoyed guiding her through package curation and creating tailored packages for her potential leads. Working collaboratively across departments has always been a challenge Iâ€™ve tasked myself with since my very first performance review, and in retrospect can see how this has naturally transpired over the last two years.",
        "What blockers or challenges did you experience in this review period that made it harder to achieve your goals?": "While I enjoy experimenting with new ways of working and making adjustments to my workflow, a notable change which blocked my productivity was the jobs tracker. As mentioned when it was first introduced, this created an unintentional feeling of pressure across the Bookings Team which impacted how seamlessly the Bookings Team worked together pre-tracker. I valued how responsive Kirsty and Shannon were when receiving feedback on the tracker and took immediate action to clarify the intentions of the tracker. This feeling very quickly died down after we were reassured, which is a testament to how consistently supportive and reactive Kirsty and Shannon are to blockers flagged in the Bookings Team.",
        "In what ways have you developed during this review period?": "Upon reflection, Iâ€™ve enjoyed taking on more responsibility which has led me to further develop my professional skills. This steady increase in progression has allowed me to adapt at a natural pace without feeling too overwhelmed and has instead motivated me for future challenges to come. Iâ€™ve seen how feeling stagnant in my role can eventually give me clarity on where I hope to progress towards and am appreciative of how supportive and patient Kirsty and Shannon had been during the process. \n\nIâ€™ve also enjoyed working across departments and providing insights to contribute to the wider team.  Iâ€™ve learned to host workshops, hold shadowing calls and schedule screenings - all of which have improved my skills in public speaking, empathy, active listening, time management, organisation and planning; skills I look forward to utilising as I further progress up the Bookings Progression Ladder.",
        "What are 2-3 skills youâ€™d like to acquire, develop or refine over the next review period? Do you feel there is an area of potential that you haven't explored yet?": "I believe the more you practice, the better you become (as cheesy as that sounds!). Rather than prioritising another area of potential I haven't yet explored, Iâ€™d like to further refine the skills Iâ€™ve acquired over this review period by continuing with similar responsibilities and more. \n\nPlanning another workshop and setting up another shadowing call with the wider team would be a great way to further develop those skills. Iâ€™d like to take onboard learnings from my first workshop/shadowing call to create a better experience for those involved. \n \nAssisting with the hiring process is also something Iâ€™d like to continue with as not only was it something I enjoyed, I also valued the interpersonal skills I picked up which Iâ€™d like to further improve on.\n\nIâ€™m also looking forward to further mentoring my peers by contributing in their goal alignment calls with Kirsty. A natural progression in the Bookings Progression Ladder would be for my role to have a direct report, which I hope this responsibility will help prepare me for.",
        "If you would like, provide any additional information that wasn't captured in the above form.(optional)": "The last month or so had been a difficult time for the company, taking its toll on everyone in individual ways. Not once had I felt unsupported by my peers. I'm however most grateful to Kirsty and Shannon in particular who've been consistently supportive, reassuring and empathetic every step of the way. Finding a workplace you can feel safe and accepted in is one thing, but having caring managers like Kirsty and Shannon who have nurtured, encouraged and listened to me from the day I started is a rarity - so thank you for being amazing and teaching me what it means to lead a team!"
